import React from "react";

// react-bootstrap components
import {
  Badge,
  Button,
  Card,
  Form,
  Navbar,
  Nav,
  Container,
  Row,
  Col,
} from "react-bootstrap";
import styles from "./index.module.css";
import SabhasadregistrationForm from "components/AssemlyForm/assembly";
function Sabhasadregistration() {
  return (
    <>
      <Container fluid>
        <Row>
          <Col md="12">
            <Card>
              <Card.Header>
                <div className={styles.cardtitle}> Sabhasad Registration</div>
              </Card.Header>

                <SabhasadregistrationForm />

            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Sabhasadregistration;
